		/// <summary>
		/// Raises the <see cref="ColumnChanged" /> event.
		/// </summary>
		/// <param name="column">The <see cref="VendorColumn"/> which has raised the event.</param>
		public virtual void OnColumnChanged(VendorColumn column)
		{
			OnColumnChanged(column, null);
